-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `vistanegociosprotectoras`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `vistanegociosprotectoras` AS select `u`.`id` AS `UsuarioID`,`u`.`nombreUser` AS `NombreUsuario`,`u`.`email` AS `EmailUsuario`,`u`.`telefonoContacto` AS `TelefonoContacto`,`n`.`idNegocio` AS `NegocioID`,`n`.`nombreNegocio` AS `NombreNegocio`,`n`.`direccion` AS `DireccionNegocio`,`n`.`descripcion` AS `DescripcionNegocio`,`n`.`fotos` AS `FotosNegocio`,`n`.`puntuacion` AS `PuntuacionNegocio`,`tn`.`nombre` AS `TipoNegocio`,`p`.`idProtectora` AS `ProtectoraID`,`p`.`nombreProtectora` AS `NombreProtectora`,`p`.`direccion` AS `DireccionProtectora`,`p`.`descripcion` AS `DescripcionProtectora`,`p`.`fotos` AS `FotosProtectora` from (((`usuario` `u` left join `negocio` `n` on((`u`.`id` = `n`.`Usuario_id`))) left join `tiponegocio` `tn` on((`n`.`tipoNegocio_id` = `tn`.`id`))) left join `protectoras` `p` on((`u`.`id` = `p`.`Usuario_id`))) 
;

